package com.graphy.unit.ocr.aly;


import com.alibaba.fastjson.JSON;
import com.alibaba.fastjson.JSONArray;
import com.alibaba.fastjson.JSONException;
import com.alibaba.fastjson.JSONObject;
import org.apache.http.HttpResponse;
import org.apache.http.util.EntityUtils;
import com.graphy.unit.ocr.OcrCommom;
import com.graphy.unit.ocr.aly.assist.AlyHttp;
import com.graphy.unit.ocr.aly.attr.IdCardResult;

import java.util.HashMap;
import java.util.Map;

/**
 * 阿里云Ocr智能识别身份证
 */
public class IdCard {


    public static void main(String[] args) throws Exception {
        String base64 = "data:image/jpg;base64,";
        //3ba35d8ceb6f407e85416470f45665e3  星捷安账户
        IdCardResult result = IdCard.analyze3(base64, "3ba35d8ceb6f407e85416470f45665e3");
        System.out.println(JSONObject.toJSONString(result));
    }

    /**
     * 四川涪擎大数据技术有限公司-身份证OCR
     *
     * @return
     */
    public static IdCardResult analyze1(String base64, String appCode) throws Exception {
        String host = "https://ocridcard.market.alicloudapi.com";
        String path = "/idCardAuto";
        String method = "POST";
        Map<String, String> headers = new HashMap<String, String>();
        headers.put("Authorization", "APPCODE " + appCode);
        //根据API的要求，定义相对应的Content-Type
        headers.put("Content-Type", "application/x-www-form-urlencoded; charset=UTF-8");
        Map<String, String> querys = new HashMap<String, String>();
        Map<String, String> bodys = new HashMap<String, String>();
        bodys.put("image", base64);
        HttpResponse response = AlyHttp.doPost(host, path, method, headers, querys, bodys);
        JSONObject res = JSONObject.parseObject(EntityUtils.toString(response.getEntity()));
        IdCardResult result = JSONObject.parseObject(res.getString("result"), IdCardResult.class);
        return result;
    }


    /**
     * 阿里云官方-身份证OCR
     *
     * @return
     */
    public static IdCardResult analyze2(String base64, String appCode) throws Exception {
        base64 = OcrCommom.cutBase64(base64);
        String host = "http://dm-51.data.aliyun.com";
        String path = "/rest/160601/ocr/ocr_idcard.json";
        Boolean is_old_format = false;//如果文档的输入中含有inputs字段，设置为True， 否则设置为False
        //请根据线上文档修改configure字段
        JSONObject configObj = new JSONObject();
        configObj.put("side", "face");
        String config_str = configObj.toString();
        //            configObj.put("min_size", 5);
        //            String config_str = "";

        String method = "POST";
        Map<String, String> headers = new HashMap<String, String>();
        //最后在header中的格式(中间是英文空格)为Authorization:APPCODE 83359fd73fe94948385f570e3c139105
        headers.put("Authorization", "APPCODE " + appCode);
        Map<String, String> querys = new HashMap<String, String>();
        // 对图像进行base64编码
        String imgBase64 = base64;

        // 拼装请求body的json字符串
        JSONObject requestObj = new JSONObject();
        if (is_old_format) {
            JSONObject obj = new JSONObject();
            obj.put("image", getParam(50, imgBase64));
            if (config_str.length() > 0) {
                obj.put("configure", getParam(50, config_str));
            }
            JSONArray inputArray = new JSONArray();
            inputArray.add(obj);
            requestObj.put("inputs", inputArray);
        } else {
            requestObj.put("image", imgBase64);
            if (config_str.length() > 0) {
                requestObj.put("configure", config_str);
            }
        }
        String bodys = requestObj.toString();
        HttpResponse response = AlyHttp.doPost(host, path, method, headers, querys, bodys);
        int stat = response.getStatusLine().getStatusCode();
        if (stat != 200) throw new Exception("身份证解析失败.错误码为(" + stat + ")");
        String res = EntityUtils.toString(response.getEntity());
        JSONObject res_obj = JSON.parseObject(res);
        JSONObject value = null;
        if (is_old_format) {
            JSONArray outputArray = res_obj.getJSONArray("outputs");
            String output = outputArray.getJSONObject(0).getJSONObject("outputValue").getString("dataValue");
            value = JSON.parseObject(output);
        } else {
            value = res_obj;
        }
        IdCardResult returnValue = new IdCardResult();
        returnValue.setAddress(value.getString("address"));
        returnValue.setBirthday(value.getDate("birth"));
        returnValue.setName(value.getString("name"));
        returnValue.setCode(value.getString("num"));
        returnValue.setSex(value.getString("sex"));
        returnValue.setNation(value.getString("nationality"));
        return returnValue;
    }

    /**
     * 阿里云官方-身份证OCR
     *
     * @return
     */
    public static IdCardResult analyze3(String base64, String appCode) throws Exception {
        base64 = OcrCommom.cutBase64(base64);
        String host = "https://ocrphoto.market.alicloudapi.com";
        String path = "/ocr/photo";
        String method = "POST";
        Map<String, String> headers = new HashMap<String, String>();
        //最后在header中的格式(中间是英文空格)为Authorization:APPCODE 83359fd73fe94948385f570e3c139105
        headers.put("Authorization", "APPCODE " + appCode);
        //根据API的要求，定义相对应的Content-Type
        headers.put("Content-Type", "application/x-www-form-urlencoded; charset=UTF-8");
        Map<String, String> querys = new HashMap<String, String>();
        Map<String, String> bodys = new HashMap<String, String>();
        bodys.put("image", base64);
        bodys.put("side", "front");
        HttpResponse response = AlyHttp.doPost(host, path, method, headers, querys, bodys);
        JSONObject res = JSONObject.parseObject(EntityUtils.toString(response.getEntity()));
        JSONObject data = res.getJSONObject("data");
        IdCardResult result = JSONObject.parseObject(data.toJSONString(), IdCardResult.class);
        result.setHeadPhoto(data.getString("photo"));
        result.setCode(data.getString("idcard"));
        return result;
    }

    /*
     * 获取参数的json对象
     */
    private static JSONObject getParam(int type, String dataValue) {
        JSONObject obj = new JSONObject();
        try {
            obj.put("dataType", type);
            obj.put("dataValue", dataValue);
        } catch (JSONException e) {
            e.printStackTrace();
        }
        return obj;
    }


}
